import React,{createContext} from "react";
import Gallery from "./Gallery";
const money=createContext();
function Contact()
{  
    const name="manish"
    return(
        <>
        <h1>A is Component={name}</h1>
        <money.Provider value={name}>
            <Gallery/>
        </money.Provider>
        </>
    )
}
export default Contact;
export{money};
